            let schedule ={
                name: obj.location.name,
            }
        });

        return(
            <div>
                <div className="card">

                    <div className="card-title">
                        <Hospital />
                    </div>
                    <div className="card-body">
                        <AvailableTimes />
                        <RedirectButton />
                    </div>
                </div>
            </div>
        );
    };
}

export default App;
